import React from "react";
import pic from "../images/2023_07_07_CV_Bastian Dammann.jpg";

const AboutPage = () => {
  return (
    <div>
      <div
        class="badge-base LI-profile-badge"
        data-locale="en_US"
        data-size="medium"
        data-theme="light"
        data-type="VERTICAL"
        data-vanity="bastian-dammann-a25b6613b"
        data-version="v1"
      >
        <a
          class="badge-base__link LI-simple-link"
          href="https://de.linkedin.com/in/bastian-dammann-a25b6613b?trk=profile-badge"
        >
          Bastian Dammann
        </a>
      </div>
      <div>
        <img
          style={{
            padding: "50px",
            width: "50vw",
            position: "absolute",
            top: "0",
            bottom: "0",
            left: "200px",
          }}
          src={pic}
          alt=""
        />
      </div>
    </div>
  );
};

export default AboutPage;
